import React, { Component } from 'react'
import Task from './components/task'

class TaskContainer extends Component {
    tasks = () => {
        this.props.tasks.map(task => <Task key={task.id} task={task} />)
    }

    render() {
        return "this"
    }
}

export default TaskContainer
